              "STKR__Days_Overdue__c": 232,
              "STKR__Notes_Long__c": "Biologist Routine    -\r\n-Routine Inspection  - The supply, installation and maintenance of Rodent baits to contract areas - The supply and installation of insect monitoring devices to all suitable locations - A minimum of 12 routine service/inspections per annum. - Treatments using appropriate pesticides when an infestation of contract pests is found as a resultof the monitoring and inspection visits. - Un limited call out service against Contract Pests - Mouse bait stations will be plastic tamper proof and lockable clearly marked with contact details. - We will bait all supplied bait stations with a suitable and effective rodenticide - Insect Monitoring will comprise of the supply and installation of plastic monitor stations, for earlydetection of insects. Where activity is found we would report to customer and upon authorisationtreat - We will provide a location list indicating the position of all bait points and all insect monitor traps. - All baits will be numbered for ease of reference and marked accordingly on the bait plan and sitespecific COSHH assessment. - All call out requests will be answered 7 days a week. Should any requests for emergencytreatments arise, then we will endeavour to attend site the following or same day. - Should any infestation become evident, weekly checks will be made until no further activity hasbeen found  -\r\n-",
